var faker = require('faker');

function create_users(){

  for (let i=0; i < 25; i++){

  const id = i;
  const lastName = faker.name.lastName();
  const firstName = faker.name.firstName();

  const arrayUsers = [id, lastName, firstName];
  arrayUsers.push({id, lastName, firstName});

  setUsers(arrayUsers);
